const PaymentStatus = () => {
  return (
    <div className="bg-white p-6 rounded-lg shadow">
      <h2 className="text-xl font-bold mb-4">이번 달 미납 현황</h2>
      <div className="space-y-3">
        {/* localStorage에서 미납 데이터를 가져와 표시 */}
        <div className="text-gray-600">미납 내역이 없습니다.</div>
      </div>
    </div>
  );
};

export default PaymentStatus;
